import React, { useEffect, useState } from "react";
import axios from "axios";

const Employee = () => {
  const [employees, setEmployees] = useState([]); // State to hold employees data

  // Fetch employees from backend API
  useEffect(() => {
    const fetchEmployees = async () => {
      try {
        const response = await axios.get("http://localhost:3005/getemployee"); // Replace with your API endpoint
        setEmployees(response.data); // Assuming the response contains an array of employees
      } catch (error) {
        console.error("Error fetching employees:", error);
      }
    };

    fetchEmployees();
  }, []);

  return (
    <div className="p-4">
      <h2 className="text-2xl font-bold mb-4">Employee List</h2>
      {employees.length > 0 ? (
        <table className="min-w-full border border-gray-300">
          <thead>
            <tr>
              <th className="border border-gray-300 px-4 py-2">SL No</th>
              <th className="border border-gray-300 px-4 py-2">Employee ID</th>
              <th className="border border-gray-300 px-4 py-2">
                Employee Name
              </th>
              <th className="border border-gray-300 px-4 py-2">
                Contact Number
              </th>
              <th className="border border-gray-300 px-4 py-2">
                Active Status
              </th>
            </tr>
          </thead>
          <tbody>
            {employees.map((employee, index) => (
              <tr key={employee._id} className="hover:bg-gray-100">
                <td className="border border-gray-300 px-4 py-2">
                  {index + 1}
                </td>
                <td className="border border-gray-300 px-4 py-2">
                  {employee.employeeId}
                </td>
                <td className="border border-gray-300 px-4 py-2">
                  {employee.employeeName}
                </td>
                <td className="border border-gray-300 px-4 py-2">
                  {employee.contactNumber}
                </td>
                <td className="border border-gray-300 px-4 py-2">
                  {employee.isActive ? "Online" : "Offline"}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No employees available</p>
      )}
    </div>
  );
};

export default Employee;
